PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "users_customuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_customuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_emailconfirmation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "sent" datetime NULL, "key" varchar(64) NOT NULL UNIQUE, "email_address_id" integer NOT NULL REFERENCES "account_emailaddress" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_emailaddress" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "verified" bool NOT NULL, "primary" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "email" varchar(254) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "core_subcategory_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subcategory_id" bigint NOT NULL REFERENCES "core_subcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NOT NULL REFERENCES "core_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "carts_orderitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "price" real NOT NULL, "quantity" integer NOT NULL, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "order_id" bigint NOT NULL REFERENCES "carts_order" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "carts_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "create_at" datetime NOT NULL, "qunatity" integer NOT NULL, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_myfav" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_item_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NOT NULL REFERENCES "core_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_item_subcategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "subcategory_id" bigint NOT NULL REFERENCES "core_subcategory" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_category_collections" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category_id" bigint NOT NULL REFERENCES "core_category" ("id") DEFERRABLE INITIALLY DEFERRED, "collections_id" bigint NOT NULL REFERENCES "core_collections" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rating_ratingsystem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rating" integer NOT NULL, "rate_in" varchar(255) NULL, "created_at" date NULL, "updated_at" date NOT NULL, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_site" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "domain" varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp_sites" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "socialapp_id" integer NOT NULL REFERENCES "socialaccount_socialapp" ("id") DEFERRABLE INITIALLY DEFERRED, "site_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "provider" varchar(30) NOT NULL, "name" varchar(40) NOT NULL, "client_id" varchar(191) NOT NULL, "secret" varchar(191) NOT NULL, "key" varchar(191) NOT NULL, "provider_id" varchar(200) NOT NULL, "settings" text NOT NULL CHECK ((JSON_VALID("settings") OR "settings" IS NULL)));
CREATE TABLE IF NOT EXISTS "socialaccount_socialtoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" text NOT NULL, "token_secret" text NOT NULL, "expires_at" datetime NULL, "account_id" integer NOT NULL REFERENCES "socialaccount_socialaccount" ("id") DEFERRABLE INITIALLY DEFERRED, "app_id" integer NULL REFERENCES "socialaccount_socialapp" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "wishlist_wishlist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "create_at" datetime NOT NULL, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_customuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "phone" varchar(15) NULL, "profile_image" varchar(100) NULL, "description" text NULL, "profile_cover_image" varchar(100) NULL, "rating" integer NULL, "address" text NULL, "city" varchar(150) NULL, "state" varchar(150) NULL, "ordered" integer NULL, "country" varchar(150) NULL, "pincode" varchar(10) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "number_of_templates" integer NULL, "number_of_downloads" integer NULL, "website" varchar(200) NULL, "contact_facebook" varchar(200) NULL, "contact_twitter" varchar(200) NULL, "number_of_gifts" integer NOT NULL, "approved" bool NOT NULL, "pro" bool NOT NULL, "email" varchar(100) NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "core_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NULL, "slug" varchar(150) NULL, "image" varchar(100) NULL, "description" text NULL, "status" bool NOT NULL, "trending" bool NOT NULL, "meta_title" varchar(150) NULL, "meta_keywords" varchar(150) NULL, "meta_description" varchar(150) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "created_by_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "number_of_likes" integer NOT NULL, "number_of_views" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "core_collections" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NULL, "slug" varchar(150) NULL, "description" text NULL, "status" bool NOT NULL, "trending" bool NOT NULL, "meta_title" varchar(150) NULL, "meta_keywords" varchar(150) NULL, "meta_description" varchar(150) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "created_by_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "image_background" varchar(100) NULL, "thumbnail_clooection" varchar(100) NULL, "number_of_likes" integer NOT NULL, "number_of_views" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "core_subcategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NULL, "slug" varchar(150) NULL, "image" varchar(100) NULL, "description" text NULL, "status" bool NOT NULL, "trending" bool NOT NULL, "meta_title" varchar(150) NULL, "meta_keywords" varchar(150) NULL, "meta_description" varchar(150) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "number_of_likes" integer NOT NULL, "number_of_views" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "core_socialmedia" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "url" varchar(200) NOT NULL, "icon" varchar(100) NULL, "created_at" datetime NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "core_contact_us" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "email" varchar(254) NOT NULL, "subject" varchar(50) NOT NULL, "message" text NOT NULL, "create_at" datetime NOT NULL, "number" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "wishlist_likeitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "create_at" datetime NOT NULL, "item_id" bigint NOT NULL REFERENCES "core_item" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_item" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "file" varchar(100) NULL, "url_download" varchar(200) NULL, "url_download2" varchar(200) NULL, "url_downloa3" varchar(200) NULL, "url_gitgub" varchar(200) NULL, "url_gitlab" varchar(200) NULL, "demo" varchar(200) NULL, "demo1" varchar(200) NULL, "demo2" varchar(200) NULL, "demo3" varchar(200) NULL, "slug" varchar(150) NULL UNIQUE, "theme_image" varchar(100) NULL, "theme_image1" varchar(100) NULL, "theme_image2" varchar(100) NULL, "theme_image3" varchar(100) NULL, "theme_image4" varchar(100) NULL, "theme_image5" varchar(100) NULL, "theme_image6" varchar(100) NULL, "theme_image7" varchar(100) NULL, "theme_image8" varchar(100) NULL, "published_date" date NOT NULL, "language" varchar(3) NOT NULL, "version" integer NULL, "available" varchar(10) NOT NULL, "number_of_views" integer NOT NULL, "number_of_likes" integer NOT NULL, "small_description" text NULL, "description" text NULL, "Features" text NULL, "how_to_use" text NULL, "number_of_downloads" integer NOT NULL, "original_price" real NULL, "selling_price" real NULL, "size" integer unsigned NULL CHECK ("size" >= 0), "status" bool NOT NULL, "trending" bool NOT NULL, "rating" integer NOT NULL, "tags" varchar(150) NULL, "meta_title" varchar(150) NULL, "meta_keywords" varchar(150) NULL, "meta_description" varchar(150) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "approved" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "long_title" varchar(250) NULL, "number_pages" integer NOT NULL, "url_index" varchar(200) NULL, "url_readme" varchar(200) NULL, "url_gitbuck_drive" varchar(200) NULL, "url_google_drive" varchar(200) NULL, "url_one_drive" varchar(200) NULL, "editors_choice" bool NOT NULL, "theme_image_url" varchar(200) NULL, "theme_image_url_1" varchar(200) NULL, "theme_image_url_2" varchar(200) NULL, "theme_image_url_3" varchar(200) NULL, "theme_image_url_4" varchar(200) NULL, "theme_image_url_5" varchar(200) NULL, "theme_image_url_6" varchar(200) NULL, "theme_image_url_7" varchar(200) NULL, "theme_image_url_8" varchar(200) NULL, "theme_image_url_9" varchar(200) NULL);
CREATE TABLE IF NOT EXISTS "socialaccount_socialaccount" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "provider" varchar(200) NOT NULL, "uid" varchar(191) NOT NULL, "last_login" datetime NOT NULL, "date_joined" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "extra_data" text NOT NULL CHECK ((JSON_VALID("extra_data") OR "extra_data" IS NULL)));
CREATE TABLE IF NOT EXISTS "sliders_sliderhome" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(20) NOT NULL, "description" varchar(150) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "number_of_views" integer NOT NULL, "number_of_clicks" integer NOT NULL, "url" varchar(200) NOT NULL, "image" varchar(100) NULL, "image_url" varchar(200) NULL);
CREATE TABLE IF NOT EXISTS "carts_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fname" varchar(150) NOT NULL, "lname" varchar(150) NOT NULL, "email" varchar(150) NOT NULL, "phone" varchar(150) NOT NULL, "address" text NOT NULL, "city" varchar(150) NOT NULL, "pincode" varchar(150) NOT NULL, "total_price" real NOT NULL, "payment_mode" varchar(150) NOT NULL, "payment_id" varchar(150) NOT NULL, "message" text NULL, "tracking_no" varchar(150) NOT NULL, "create_at" datetime NOT NULL, "update_at" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "country" varchar(150) NOT NULL, "stats" varchar(150) NOT NULL, "state" varchar(150) NULL);
